package analysis.syntaxtree;import analysis.visitors.TypeVisitor;import analysis.visitors.Visitor;public class Program {  public MainClass m;  public ClassDeclList cl;  public Program(MainClass ma, ClassDeclList cList) {    m = ma;    cl = cList;  }  public void accept(Visitor v) {    v.visit(this);  }  public void accept(TypeVisitor v) {    v.visit(this);  }}